<p>所以为什么我们不自己写一个类，让他来控制所有文件的存取呢？我们可以给每一个加载的内容都带上一个特殊的id，想要的时候再通过id把它取出来，这样既能保证文件只被加载一次，同时也能让存取的步骤更加的简单：</p>
<figure><figcaption></figcaption></figure>
<p>load函数的实现：</p>
<figure><figcaption></figcaption></figure>
<p>get函数的实现：</p>
